export default function Progress({ numQuestions, activeQuestion, maxPoints }) {
  return (
    <header className="progress">
      <progress />
      <p>
        Question <strong>{activeQuestion + 1}</strong>/{numQuestions}
      </p>
      <p>
        <strong>X</strong>/{maxPoints}
      </p>
    </header>
  );
}
